import React from 'react';
import {Tram} from './components/Login';

let isLogin = false;

const changeStatus = () => {
    isLogin = true;
    Tram.check = true;
    console.log(isLogin);
    console.log(Tram.check);
}

export const lam = {isLogin, changeStatus};
